// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "../types/Structs.sol";

interface ISMCDappBookingFood {
    // --- Events ---
    event RestaurantRegistered(uint128 indexed restaurantId, address indexed owner);
    event StaffAssigned(uint128 indexed restaurantId, address indexed staff, address indexed assigner);
    event RoleSet(address indexed user, Role indexed role, address indexed setter);
    event ServiceFeeUpdated(uint8 newPercentage, address indexed setter);

    event MenuItemAdded(uint128 indexed menuId, uint128 indexed restaurantId, string name); 
    event MenuItemUpdated(uint128 indexed menuId, uint128 indexed restaurantId); 
    event MenuItemRemoved(uint128 indexed menuId, uint128 indexed restaurantId); 
    event MenuItemRated(uint128 indexed menuId, uint128 indexed restaurantId, uint8 rating, address indexed rater); 

    event OrderPlaced(uint128 indexed orderId, address indexed customer, uint128 totalPrice); 
    event OrderStatusUpdated(uint128 indexed orderId, OrderStatus status, address indexed updater); 
    event OrderCancelled(uint128 indexed orderId, address indexed canceller, uint128 amountRefunded); 
    event OrderCompleted(uint128 indexed orderId, address indexed completer); 

    event EmployeeRated(address indexed employee, address indexed customer, uint128 indexed restaurantId, uint8 rating, string comment); 
    event RestaurantRated(uint128 indexed restaurantId, address indexed customer, uint8 rating, string comment); 

    // --- Manager Setters ---
    function setMenuManager(address menuManagerAddress) external;
    function setRestaurantManager(address restaurantManagerAddress) external;
    function setOrderManager(address orderManagerAddress) external;
    function setRatingManager(address ratingManagerAddress) external;

    // --- Functions to be called by Managers ---

    // Restaurant Management
    function registerRestaurant(address restaurantOwnerAddress, string memory restaurantName) external returns (uint128);
    function assignStaff(uint128 restaurantId, address staffAddressToAssign, address assignerAddress) external;
    function setRole(address userAddress, Role roleToSet, address setterAddress) external;
    function setServiceFeePercentage(uint8 percentage, address setterAddress) external;

    // Menu Management
    function addMenuItem(uint128 restaurantId, uint128 menuId, string memory itemName, string memory imageUrl, string memory videoUrl, uint128 price, string memory description, string memory category, uint128 preparationTime) external;
    function updateMenuItem(uint128 restaurantId, uint128 menuId, string memory itemName, string memory imageUrl, string memory videoUrl, uint128 price, bool isAvailable, string memory description, string memory category) external;
    function removeMenuItem(uint128 restaurantId, uint128 menuId) external;
    function rateMenuItem(uint128 restaurantId, uint128 menuId, uint8 ratingValue, address raterAddress) external;

    // Order Management
    function placeOrder(address customerAddress, uint128 restaurantId, OrderDetail[] memory itemsToOrder, uint256 paidAmountByCustomer) external payable returns (uint128 orderId, uint128 totalPrice);
    function updateOrderStatus(uint128 orderIdToUpdate, OrderStatus newStatus, address updaterAddress) external;
    function cancelOrder(uint128 orderIdToCancel, address cancellerAddress) external returns (bool success, uint128 amountRefunded);
    function completeOrder(uint128 orderIdToComplete, address completerAddress) external;

    // Rating Management
    function rateEmployee(address raterAddress, address employeeAddress, uint128 restaurantId, uint8 ratingValue, string memory commentText) external;
    function rateRestaurant(address raterAddress, uint128 restaurantId, uint8 ratingValue, string memory commentText) external;

    // --- Getter Functions ---
    function nextRestaurantId() external view returns (uint128);
    function nextOrderId() external view returns (uint128);
    function nextMenuId() external view returns (uint128);

    function roles(address account) external view returns (Role);
    function staffRestaurant(address staffAddress) external view returns (uint128);
    function restaurantOwners(uint128 restaurantId) external view returns (address);
    function menuByRestaurant(uint128 restaurantId, uint128 menuId) external view returns (MenuItem memory);
    function orders(uint128 orderId) external view returns (Order memory); 

    function getOrderDetailsList(uint128 orderId) external view returns (OrderDetail[] memory); 
    function ownerRestaurants(address ownerAddress) external view returns (uint128[] memory);
    function restaurantMenuIds(uint128 restaurantId) external view returns (uint128[] memory);
    function employeeRatings(address employeeAddress) external view returns (RatingForEmployee[] memory);
    function restaurantRatings(uint128 restaurantId) external view returns (RatingForRestaurant[] memory);
    function serviceFeePercentage() external view returns (uint8);
    function getRestaurantOrderIds(uint128 restaurantId) external view returns (uint128[] memory);

    // Helper/View functions
    function isAdmin(address account) external view returns (bool);
    function isStaff(address account, uint128 restaurantId) external view returns (bool);
    function isRestaurantOwner(address account, uint128 restaurantId) external view returns (bool);
    function restaurantExists(uint128 restaurantId) external view returns (bool);
    function menuExists(uint128 restaurantId, uint128 menuId) external view returns (bool);

    // Các hàm tổng hợp dữ liệu (Advanced Getters)
    function getMenuItems(uint128 restaurantId, uint128 startIndex, uint128 limitCount) external view returns (MenuItem[] memory);
    function getMyOrders(address customerAddress) external view returns (Order[] memory);
    function getAllOrders(uint128 startIndex, uint128 limitCount) external view returns (Order[] memory);
    function getOrderDetails(uint128 orderId) external view returns (Order memory orderInfo, MenuItem[] memory menuItems, uint128[] memory quantities); // Giữ lại hàm này
}

